            .then(response => {
                debugger;
                this.props.setUserProfile(response.data)
            });
    }

    render() {
        return (
            <div>
                <Profile {...this.props} />
            </div>
        )
    }}

let mapStateToProps = (state) => ({
    profile: state.user.profile,
})


